import { Container, Row, Col } from "react-bootstrap";

export const Project = () => {

    const projects = [
        {
            title: "Business Startup",
            description: "Design & Development",
            imgUrl: projImg1,
        }
    ]
    return (
        <section className="project" id="project">
            <Container>
                <Row>
                    <Col>
                        <h2>Projects</h2>
                        <p> </p>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}
